// SPDX-License-Identifier: MIT

pragma solidity >=0.4.22 <0.9.0;

contract PlantMonitor {

    struct Plant {
        uint256 humidity;
        uint256 temperature;
        bool isHealthy;
    }

    // Mapping to store plant data against plant ID
    mapping(uint256 => Plant) public plants;

    // Function to update plant data
    function updatePlantData(uint256 _plantId, uint256 _humidity, uint256 _temperature, bool _isHealthy) public {
        plants[_plantId] = Plant(_humidity, _temperature, _isHealthy);
    }

    // Function to get plant data
    function getPlantData(uint256 _plantId) public view returns (uint256, uint256, bool) {
        Plant memory plant = plants[_plantId];
        return (plant.humidity, plant.temperature, plant.isHealthy);
    }
}
